import { Header } from "./Header";
import { Footer } from './Footer';
import './App.css';
import './Basket.css';


function Rectangle18() {
    return (
    <div className="rectangle18">
        <div className="image-class"></div>
        <div className="text-class">Basket Total: 230 TL</div>
        <div className="rectangle17">
        <div className="purchase-text">Purchase</div>
        </div>
    </div>
    );
}


export default function Basket() {
return (
    <div id="main" className="main-container">
    <Header />
    <Rectangle18 />
    <Footer />
    </div>
);
}
